Shibuya - fashion, bars, clubs, young people,  restaurants.
- Shibuya Scramble Square Building:
  - Shibuya sky - really nice observatory.
  - 11th floor there is a coworking with a lookout on Shibuya crossing. hourly 1650 yen or 5500 per day (0800-2300, good for late working)
