- Mandarake - large anime store with lots of stuff
Shinjuku - bars, clubs, business, adult entertainment:
- kabukicho - the shady center of shinjuku - lots of bars, clubs. Recently opened kabukicho tower is very cool
Ueno:
- Cool market along the railway, lots of fun bars and restaurants

Temples/parks:
- Sensouji - biggest buddhist temple in Tokyo
- Meiji Jingu, nice walk in the park + temple.
- Gotokuji - lucky cat temple
- Ueno park

Food:
- Food chains that are cheap but good - nakau, yoshinoya, sukiya
- Try as many things from convenience stores (konbini) - lawson, 7-11, family mart:
  - egg sandwitch, onigiri’s, all kinds of sweets - usually they also have seasonal or limited edition stuff, cool to try. Especially sweets with matcha
  - they have cold and hot drinks, try the little canned coffees, tea, etc.
  - try a strong zero or two
  - try the buns at the counter, try the family mart fried chicken (fami-chiki)
- Ramen: Ichiran (famous solo counter ramen), ippudo (pretty good chain, bit on the expensive side). Go try a random ramen shop somewhere walking around :)
- Torikizoku - all items on menu are like 350 yen. Cool to try out. They have free cabbage refills lol
- Oyakodon, gyuudon, okonomiyaki, soba, yakiniku. Curry rice, katsudon, katsu curry. Mochi with anything other than ice cream for desert - for example, anko paste`)

